import './Signup.css'

import Crypto from '../assets/trade.png'

const Signup = () => {
  return (
    <div className = 'signup'>
        <div className = 'container'>
            {/* left */}
            <div className = 'left'>
                <img src = {Crypto} alt = '' />

            </div>
            {/* right */}
        </div>
    </div>
  )
}

export default Signup
